import React, { useState } from 'react'
import {useHistory} from 'react-router-dom'



export default function Navbar () {
    const history = useHistory()
    const [isAdd, setIsAdd]= useState(false)

    function toAdd (e) {
        e.preventDefault()
        if(isAdd){
            history.push('/home')
            setIsAdd(false)
        } else {
            history.push('/add')
            setIsAdd(true)
        }

    }

    return (
        <nav className="shadow navbar navbar-light" style={{backgroundColor: "#cbbcb1"}}>
                <div className="container-fluid">
                    <h1 className="navbar-brand">Admin Panel</h1>
                    <form className="d-flex">
                        {
                            isAdd ? <button onClick={toAdd} className="btn btn-dark" type="submit">Back</button> :
                            <button onClick={toAdd} className="btn btn-outline-dark" type="submit">Add Tukang</button>
                        }

                    </form>
                </div>
            </nav>
    )
}
